import React, {Component} from 'react'
import SignIn from './Sign-In'
import {BrowserRouter as  Switch} from 'react-router-dom'

class App extends Component{

  render(){
    return(
      <div>
        <Router>
          <Switch>
            <Route exact path="/" component={ SignIn }></Route>
          </Switch>
        </Router>
      </div>
    )
  }

}

export default App;
